import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/navbar.scss'; // Importing the SCSS file

const Navbar = () => {
  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/';
  };

  return (
    <nav>
      <div className="logo"><img src="/assets/logo.jpg" className='imag-width'/></div> {/* This div will be styled with the .logo class */}
      <div className="nav-links"> {/* This div will be styled with .nav-links */}
        <Link to="/">Home</Link>  {/* Links will have the styles from .nav-links a */}
        <Link to="/login">Login</Link>
        <Link to="/register">Register</Link>
      </div>
      <button className="logout-button" onClick={handleLogout}>Logout</button> {/* This button will have the styles from .logout-button */}
    </nav>
  );
};

export default Navbar;
